const Profile = ({ name, email }) => {
  return (
    <div className="profile">
      <h2 className="Profile__title">Привет, Виталий!</h2>
      <div className="profile__info">
        <p className="profile__info-text">Имя</p>
        <p className="profile__info-text">{name}</p>
      </div>
      <div className="profile__info">
        <p className="profile__info-text">E-mail</p>
        <p className="profile__info-text">{email}</p>
      </div>
      <button className="profile__btn-edit">Редактировать</button>
      <button className="profile__btn-out">Выйти из аккаунта</button>
    </div>
  );
};

export default Profile;
